INSERT INTO "Question__c" VALUES(159,'True','','','','','','2021-05-12T14:24:37.000+0000','False','','','','','0.0','False','True','','False','','','','','','','False','','2021-05-12T20:49:29.000+0000','','','','Static Txt:College Degree required','Name','False','','','','Question__c2021-05-12 14:24:37Z00000','','012750000008W9cAAE','','','','','We require a bachelors degree from a regionally accredited U.S. institution (or the international equivalent). Original transcripts are required from all undergraduate and graduate institutions you have attended, sent directly from the institution. If your institution offers electronic transcripts, please send them to Graduate Admissions (gradadmissions@stthomas.edu). Paper transcripts must be submitted in sealed envelopes and signed by the appropriate university official. These can be sent to:
